import React from 'react';
import { Image, View } from 'react-native';

export default function App() {
  return (
    <View style={{
      backgroundColor: "#fff",
      flex: 1,
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'stretch',
    }}>
      <View style={{
        backgroundColor: 'dodgerblue',
        width: '100%',
        flex: 8,
        justifyContent:"flex-start",
        alignItems: "center"
      }}>
        <Image style={{width:50, height:50}} source={require('./assets/logo_ct_rondnoir_blanc.png')}/>
      </View>
      <View style={{
        backgroundColor: 'gold',
        width: '100%',
        flex:1,
      }}/>
      <View style={{
        backgroundColor: 'tomato',
        width: '100%',
        flex:1,
      }}/>
    </View>
  ); 
}
